@Neupane1Binod @advctmaheshwar1 @amrit__aryal जिस्क्याउने हिम्मत छैन ।
ती नाबालिगले ‘धन्दा’ गरेकी होइनन् र कसैले #धन्दा गर्न हिँड्छ भनेपनि #बलात्कार गर्न पाइन्न भन्न खोजेको ।
आफूले लेखेको पढेर। आफैँ अर्थ लगाउनूहोला वा नबुझेमा #एडवोकेटलाई सोध्नूहोला ! 🙏 https://t.co/QbMdYPVdRM

@BishnuK29087091 बद्लिदो बाताबरण, खानपान, श्रब्य द्रिष्य सामाग्री को खुला पहॅूच, यौन को खुला बहस आदि सामयिक कारणहरुलाई मान्ने कि नमान्ने? बालिग हुने उमेर १८ नै हुनु पर्ने मान्यता किन? सामाजिक अनुसन्धान गरियोस् र बालिगको परिभाषा पुनरावलोकन होस्। 

सहमति बलात्कार नबनोस्
बलात्कारीलाई सजाय मिलोस्

@Mandira321 नाबालिग १८ वर्ष मुनिका बालबालिका सँगै कुनै पनि किसिमले, कुनै पनि अवस्थामा, कुनै पनि बहानामा राखिने यौन सम्बन्ध बलात्कार हो । In fact, नाबालिगसँग यौन सम्बन्ध नै हुँदैन, मात्र बलात्कार हुन्छ । 
यत्ति सबैको मतिमा सधैंका लागि घुसोस् !!!! 
नत्र कानुन ले घुसाउछ ।

@bhaabuk सन्दिपेको केशलाई बलात्कार बलत्कार भनीराछन 
मैले अहिलेसम्म बुझ्न् सकेको छैन 
कसरी भो बलात्कार ?

@NirmalG74002548 @Poudeltp29 तपाईं कानून व्यवसायी भएर सामाजिक सञ्जालमा यस्ताे लेख्न अलि  मिल्दैन कि !!
सहमती र असहमती जे भएपनि १८ बर्ष मुनि त चमत्कार नै गरेपनि बलत्कार नै हुन्छ ह‌नर ??
बरू हामीले नमिलेको कानून संशोधन गर्न दवाव दिनुपर्छ ।

@Syangjali_kale नाबालिग १८ वर्ष मुनिका बालबालिका सँगै कुनै पनि किसिमले, कुनै पनि अवस्थामा, कुनै पनि बहानामा राखिने यौन सम्बन्ध बलात्कार हो । In fact, नाबालिगसँग यौन सम्बन्ध नै हुँदैन, मात्र बलात्कार हुन्छ । 
यत्ति सबैको मतिमा सधैंका लागि घुसोस् !!!! 
नत्र कानुन ले घुसाउछ ।

@khadkap21 र, इज्जत नारी र पुरूष दुबैको लागि समान हो । आरोप प्रमाणित हुनुअघि नै एकको नामलाई निर्विवेक बाहिर ल्याउँनु र अर्कोकोलाई छुपाएर राख्ने विभेद राज्यले गरिरहेको विषय असङ्गतिलो हो । 

एकपक्षको मात्र नाम आगो फैलिएझैं
बाहिर ल्याउँदा कुनैपनि मानसिकतावश अर्को दूर्घटना घट्यो भने पूर्ति के ?

@CricketNep पहिला पहिला बारीमा झाडीमा बाटोमा अन्धकार रातिमा बलात्कार हुन्थ्यो।
अहिले रंगिन रातमा होटेलका खाटमा बलात्कार हुन्छ।
Master Mind को बलात्कारी कि बलात्कृत।
